					}
		/* body */
			.UVgjof {
				color: main-text;
				border-color: main-border;
			}
			/* links */
				a {
					color: main-link;
				}
			/* checkboxes */
				.jfk-checkbox {
					background-color: main-bg-em;
					border-color: main-separator;
				}
				/* hover */
					.jfk-checkbox-hover {
						box-shadow: inset 0px 1px 1px alpha(black, 0.4);
					}
				/* focused */
					.jfk-checkbox-focused {
						border-color: accent-shifted(0deg, 10%, 4%);
					}
				/* checkmark */
					.jfk-checkbox-checked .jfk-checkbox-checkmark {
						filter: colorize(white);
					}
		/* safesearch locked icon */
			.lockImg {
				filter: colorize(main-text-off);
			}
			/* locking loading icon */
				#statusIcon img {
					filter: invert-with-bg(main-bg);
				}
			/* locking success icon */
				#lockres img {
					//TODO
				}
		/* slider */
			.goog-slider li {
				color: main-text;
			}
			/* thumb */
				.goog-slider-thumb {
					background-color: main-bg-em;
					background-image: none;
					border-color: main-text;
				}
				/* hover */
					.goog-slider-thumb:hover {
						background-color: main-bg-em;
						background-image: none;
						border-color: main-text;
					}
				/* focus */
					.goog-slider:focus .goog-slider-thumb {
						background-color: main-bg-em;
						background-image: none;
						border-color: main-text;
					}
			/* labels */
				.sllabel {
					color: main-text-off;
				}
		/* radio button */
			.jfk-radiobutton-radio {
				border-color: main-text;
			}
			/* checked */
				.jfk-radiobutton-checked .jfk-radiobutton-radio::after {
					background-color: main-text;
					border-color: main-text;
				}
			/* hover */
				.jfk-radiobutton:hover .jfk-radiobutton-radio {
					border-color: main-text-em;
				}
			/* focused */
				.jfk-radiobutton:focus .jfk-radiobutton-radio {
					border-color: accent-shifted(0deg, 10%, 4%);
				}
		/* regions & languages */
			/* show more */
				/* arrow */
					/* collapsed */
						#regionanchormore .UyLz9e, #langanchormore .bM5AHd {
							border-top-color: main-link !important;
						}
					/* expanded */
						#regionanchorless .UyLz9e, #langanchorless .bM5AHd {
							border-bottom-color: main-link !important;
						}
		/* submit button */
			.jfk-button-action {
				background-color: accent-shifted(0deg, 10%, 4%);
				background-image: linear-gradient(to bottom, accent-shifted(0deg, 10%, 4%), accent-shifted(0deg, -7%, -1%));
				border-color: accent-shifted(0deg, -5%, -5%);
				if $light-accent {
					color: black;
				}
			}
			/* hover */
				.jfk-button-action:hover {
					background-color: accent-shifted(0deg, -9%, -5%);
					background-image: linear-gradient(to bottom, accent-shifted(0deg, 10%, 4%), accent-shifted(0deg, -9%, -5%));
					border-color: accent-shifted(4deg, -30%, -16%);
				}
		/* cancel button */
			.jfk-button-standard, .jfk-button-standard.jfk-button-clear-outline {
				button();
				background-color: main-bg-em;
			}
			.jfk-button-standard.jfk-button-hover, .jfk-button-standard.jfk-button-clear-outline.jfk-button-hover {
				button-hover();
				background-color: main-bg-em;
			}
		/* sign in hint */
			#Gm4Vke span {
				color: main-text-off !important;
			}
}

