  .lia-form-type-text::-moz-placeholder, .lia-message-editor::-moz-placeholder,
  .mce-edit-area.mce-panel::-moz-placeholder,
  .mce-form .mce-textbox::-moz-placeholder {
    color: var(--color-aaa) !important;
  }
  ::placeholder {
    color: var(--color-aaa) !important;
  }
  body {
