    background: var(--color-222) !important;
    color: var(--color-949494) !important;
  }
  .mce-widget:not(.mce-label):hover {
    background: var(--color-333) !important;
  }
  .mce-widget.mce-btn {
    color: var(--color-fff) !important;
  }
  .lia-panel .lia-panel-heading-bar, .lia-spoiler-container .lia-spoiler-link {
    background-color: var(--color-222) !important;
