    border-color: var(--color-444) !important;
    color: var(--color-ddd) !important;
  }
  .lia-panel, .lia-panel-message, .lia-message-view-display,
  .lia-tkb-article-summary-view, .lia-spoiler-container,
  .lia-tkb-content-finder .lia-search-tag-filter {
    -webkit-box-shadow: 0 1px 1px rgba(0, 0, 0, .05) !important;
            box-shadow: 0 1px 1px rgba(0, 0, 0, .05) !important;
    background-color: var(--color-222) !important;
    border: 1px solid var(--color-444) !important;
  }
  .lia-message-view-display, .lia-panel-message, .lia-panel {
    -webkit-box-shadow: none !important;
            box-shadow: none !important;
