    border-bottom: 1px solid var(--color-444) !important;
  }
  .mce-panel.mce-floatpanel {
    border: 1px solid var(--color-444) !important;
    background-image: none !important;
  }
  .mce-menu-item:not(.mce-menu-item-sep):hover, .mce-menu-item.mce-selected,
  .mce-menu-item:focus, .mce-menu-item:hover .mce-text,
  .mce-menu-item-normal.mce-active, .mce-menu-item-normal.mce-active .mce-text {
